-- Eliminando tablas
DROP TABLE IF EXISTS pelicula;
DROP TABLE IF EXISTS productora;
DROP TABLE IF EXISTS genero;
-- Creando tablas
CREATE TABLE genero(
	id_genero INT AUTO_INCREMENT,
    nombre VARCHAR(100),
    activo TINYINT,
    PRIMARY KEY(id_genero)
)ENGINE=InnoDB;
CREATE TABLE productora(
	id_productora INT AUTO_INCREMENT,
    nombre VARCHAR(300),
    logo LONGBLOB,
    R INT,
    G INT,
    B INT,
    activa TINYINT,
    PRIMARY KEY(id_productora)
)ENGINE=INNODB;
CREATE TABLE pelicula(
	id_pelicula INT AUTO_INCREMENT,
    fid_genero INT,
    fid_productora INT,
    nombre VARCHAR(500),
    fecha_estreno DATE,
    formato_doblada TINYINT,
    formato_subtitulada TINYINT,
    formato_xtreme TINYINT,
    formato_3D TINYINT,
    costo_produccion DECIMAL(16,2),
    sinopsis VARCHAR(5000),
    portada LONGBLOB,
    PRIMARY KEY(id_pelicula),
    FOREIGN KEY(fid_genero) REFERENCES genero(id_genero),
    FOREIGN KEY(fid_productora) REFERENCES productora(id_productora),
    activa TINYINT
)ENGINE=InnoDB;
