DROP PROCEDURE IF EXISTS LISTAR_GENEROS_TODOS;
DROP PROCEDURE IF EXISTS LISTAR_PRODUCTORAS_TODAS;
DROP PROCEDURE IF EXISTS INSERTAR_PELICULA;
DROP PROCEDURE IF EXISTS LISTAR_PELICULAS_TODAS;
DELIMITER $
CREATE PROCEDURE LISTAR_GENEROS_TODOS()
BEGIN
	SELECT id_genero, nombre FROM genero WHERE activo = 1;
END$
CREATE PROCEDURE LISTAR_PRODUCTORAS_TODAS()
BEGIN
	SELECT id_productora, nombre, logo, R, G, B FROM productora WHERE activa = 1;
END$
CREATE PROCEDURE INSERTAR_PELICULA(
	OUT _id_pelicula INT,
    IN _fid_genero INT,
    IN _fid_productora INT,
    IN _nombre VARCHAR(500),
    IN _fecha_estreno DATE,
    IN _formato_doblada TINYINT,
    IN _formato_subtitulada TINYINT,
    IN _formato_xtreme TINYINT,
    IN _formato_3D TINYINT,
    IN _costo_produccion DECIMAL(16,2),
    IN _sinopsis VARCHAR(5000),
    IN _portada LONGBLOB
)
BEGIN
	INSERT INTO pelicula(fid_genero,fid_productora,nombre,fecha_estreno,formato_doblada,formato_subtitulada,formato_xtreme,formato_3D,costo_produccion,sinopsis,portada,activa) VALUES(_fid_genero,_fid_productora,_nombre,_fecha_estreno,_formato_doblada,_formato_subtitulada,_formato_xtreme,_formato_3D,_costo_produccion,_sinopsis,_portada,1);
    SET _id_pelicula = @@last_insert_id;
END$
CREATE PROCEDURE LISTAR_PELICULAS_TODAS()
BEGIN
	SELECT pe.id_pelicula, g.id_genero, g.nombre AS nombre_genero, pr.id_productora, pr.nombre AS nombre_productora, pr.logo, pr.R, pr.G, pr.B, pe.nombre as nombre_pelicula, pe.fecha_estreno, pe.formato_doblada, pe.formato_subtitulada, pe.formato_xtreme, pe.formato_3D, pe.costo_produccion, pe.sinopsis, pe.portada FROM pelicula pe INNER JOIN genero g ON pe.fid_genero = g.id_genero INNER JOIN productora pr ON pe.fid_productora = pr.id_productora WHERE pe.activa = 1;
END$